import * as React from 'react';
import { Avatar, Typography } from '@mui/material';

const FriendList: React.FC = () => {
  // Заглушки для списка друзей
  const friends = [
    { id: 1, name: 'John Doe', avatarUrl: 'https://example.com/avatar1.jpg' },
    { id: 2, name: 'Jane Smith', avatarUrl: 'https://example.com/avatar2.jpg' },
    { id: 3, name: 'Bob Johnson', avatarUrl: 'https://example.com/avatar3.jpg' },
  ];

  return (
    <div>
      <Typography variant="h6">Друзья</Typography>
      {friends.map((friend) => (
        <div key={friend.id} style={{ display: 'flex', alignItems: 'center', marginBottom: '16px' }}>
          <Avatar src={friend.avatarUrl} alt={friend.name} style={{ marginRight: '16px' }} />
          <Typography>{friend.name}</Typography>
        </div>
      ))}
    </div>
  );
};

export default FriendList;
